import {GET_IMAGES, IMAGES_ERROR} from '../types'
import axios from 'axios'

export const getUsers = () => async dispatch => {

    try{
        const res = await axios.get(`http://jsonplaceholder.typicode.com/users`)
        dispatch( {
            type: GET_IMAGES,
            payload: res.data
        })
    }
    catch(e){
        dispatch( {
            type: USERS_ERROR,
            payload: console.log(e),
        })
    }

}
